import { withStyles } from "@material-ui/core/styles";

export default withStyles(theme => {
  const { colors } = theme.palette;

  return {
    container: {
      width: "75%",
      height: "75%"
    },
    number: {
      color: colors.secondary
    },
    pageTitle: {
      color: colors.main50,
      marginLeft: 10
    },
    socialLinkContainer: {
      position: "absolute",
      bottom: 0,
      left: 40
    },
    oddWorkContainer: {
      display: "flex",
      justifyContent: "flex-end",
      minHeight: "100px",
      marginTop: 20
    },
    workCard: {
      display: "flex",
      flexDirection: "row",
      width: "75%"
    },
    jobImgContainer: {
      display: "flex",
      justifyContent: "flex-end"
    },
    jobTitle: {
      color: colors.main50
    },
    img: {
      width: "100%",
      height: "100%"
    }
  };
});
